import './App.css';
import logo from  './logo_biblioteca.jpg';
import icon__perfile from './icon-perfile.jpg';
import profile_menubar from './components/profile_drop_menu';
console.log(icon__perfile);
console.log(logo);

function App() {
  return (

    <div className='container'>

     <div className='logo'> <img src={logo} width='65' alt= 'Logo'/></div>

      <div className='header'> header </div>

      <profile_menubar/>

      <div className='content'> content </div>


    </div>
  );
}


export default App;
